import bodyParser from 'body-parser';
import router from './controller/router';

const app = express();

app.use(bodyParser.urlencoded({ extended: false}));
app.use(bodyParser.json());

router(app);

app.listen(4000, () => {
  console.log('connected');
});

export default app;

