import _ from 'lodash';

class ProjectTask {
    constructor(object) {
        this.model = {
            id: null,
            summary: null,
            acceptanceCriteria: null,
            status: null
        }

        if (object){
            this.initWithObject(object);
        }
    }

    initWithObject(object) {
        this.model.id = _.get(object, 'id');
        this.model.summary = _.get(object, 'summary');
        this.model.acceptanceCriteria = _.get(object, 'acceptanceCriteria');
        this.model.acceptanceCriteria = _.get(object, 'acceptanceCriteria');

        return this;
    }

    toJSON() {
        return this.model;
    }

    hasError() {
        const errors = {};
        if (!this.model.summary){
            errors.summary = 'Summary cannot be blank';
        }
        if (!this.model.acceptanceCriteria){
            errors.acceptanceCriteria = 'Criteria cannot be blank';
        }
        return errors;
    }
}

export default ProjectTask;

